import React, { Component } from "react";
import "./../About/About.css";
export default class About extends Component {
  state = {
    userName: "mahmoud",
    lastName: "kadry",
    job: "idk",
    age: "26",
    productList: [
      { pName: "xaiomi", pPrice: 3000, pCat: "mobile", pKey: 1 },
      { pName: "apple", pPrice: 35000, pCat: "mobile", pKey: 2 },
      { pName: "samsung", pPrice: 45000, pCat: "mobile", pKey: 3 },
    ],
  };
  render() {
    return (
   "dd"
    );
  }
}
